import React from 'react';
import styled from 'styled-components';

const Div = styled.div`
	color: rgb(253, 255, 249);
	background-color: rgb(70, 81, 184);
	width: 100%;
	height: 60%;
`;

const Title = () => {
	return (
		<Div className="title">
			<i className="fas fa-book-open" />
			<h3>Journals</h3>
		</Div>
	);
};

export default Title;
